import React from 'react'
import { HeaderContainer, Header } from './SectionHeaderElements'

const SectionHeader = (props) => {
    return (
        <>
            <HeaderContainer>
                    <Header>{props.header}</Header>
            </HeaderContainer>
        </>
    )
}

export default SectionHeader
